    values ( 223 ,1 ,'CONSIGNET ARQUIVO DE MARGENS' ,0 ,'Este registro refere-se aos dados cadastrais dos servidores. Os funcionários ativos devem ser enviados todos os meses, os funcionários demitidos devem ser enviados pelo menos uma vez após a sua demissão para que o Consignet possa atualizar a data de demissão e assim não permitir mais realizar consignações para o funcionário. Recomendamos que sejam enviadas todas as informações todos os meses. O Consignet não apaga os dados e cadastra novamente, somente compara e atualiza o que foi modificado.' );
